125	bca	FAQ: dokumen apa yang diperlukan buat buka rekening...	Q: dokumen apa yang diperlukan buat buka rekening\nA: Tenang, dokumennya gak ribet kok! Cuma perlu yang standar aja \n\n **Dokumen WAJIB:**\n\n **e-KTP** (yang masih berlaku ya!)\n Foto/scan yang jelas\n Pastikan semua tulisan keliatan\n\n **Foto selfie** sambil pegang KTP\n Wajah sama KTP harus keliatan jelas\n Jangan sampai KTP nutupin muka\n\n **Foto tanda tangan** di kertas putih\n Pakai pulpen hitam\n Tanda tangan yang sama kayak di KTP\n\n **Dokumen OPSIONAL tapi direkomendasikan:**\n **NPWP** (kalau punya) - buat yang udah kerja biasanya wajib\n Kalau belum punya NPWP, nanti ada surat pernyataan aja\n\n **Plus yang penting:**\n Nomor HP aktif (buat verifikasi SMS)\n Email aktif\n Pulsa yang cukup buat SMS verifikasi\n\n**Khusus WNA:** Perlu Paspor + KITAS/KITAP\n\nGampang kan? Dokumen standar yang biasanya udah ada semua. Tinggal foto-foto aja dari HP! \n\nUdah siap dokumentnya? Yuk mulai buka rekening! 	\N	\N	2025-07-29 13:58:16.09	2025-07-29 13:58:16.09	[0.007372967433184385, 0.014356561936438084, 0.013414530083537102, -0.024932436645030975, -0.00980340875685215, 0.011530466377735138, -0.012428537011146545, -0.011272978037595749, 0.0016171542229130864, -0.01792372204363346, 0.023148857057094574, 0.0017568889306858182, -0.031777866184711456, 0.019368169829249382, -0.000518117391038686, 0.01948121376335621, 0.024467701092362404, -0.027783652767539024, 0.025120843201875687, -0.027331477031111717, -0.02745708078145981, 0.009225629270076752, -0.016378790140151978, 0.014092792756855488, 0.005532865412533283, 0.01626574620604515, 0.02362615242600441, 0.00011255314893787727, -0.008101471699774265, -0.014582648873329163, -0.00497078662738204, -0.003862329525873065, -0.011097132228314877, -0.0016987969866022468, -0.01843869872391224, 0.008566207252442837, -0.0031966271344572306, -0.023638712242245674, 0.02264644019305706, -0.007021275348961353, 0.020084112882614136, 0.0019735561218112707, -0.0166299976408