131	bca	FAQ: persyaratan dokumen WNA buka rekening BCA...	Q: persyaratan dokumen WNA buka rekening BCA\nA: Untuk WNA yang mau buka rekening BCA, ini dokumennya ya! \n\n **DOKUMEN WAJIB WNA:**\n\n **Paspor** (yang masih berlaku)\n Scan/foto halaman identitas yang jelas\n Pastikan tanggal expired masih lama\n\n **Izin Tinggal:**\n **KITAS** (Kartu Izin Tinggal Terbatas) ATAU\n **KITAP** (Kartu Izin Tinggal Tetap)\n Harus masih berlaku ya!\n\n **Foto selfie** dengan Paspor\n Wajah dan paspor harus keliatan jelas\n Background terang\n\n **Tanda tangan** di kertas putih\n Sama kayak di paspor\n Pakai pulpen hitam\n\n **DOKUMEN TAMBAHAN (kalau ada):**\n NPWP Indonesia (kalau sudah punya)\n Surat keterangan kerja/usaha di Indonesia\n Referensi bank (kalau ada)\n\n **CATATAN KHUSUS WNA:**\n Proses mungkin agak lebih lama (review tambahan)\n Beberapa jenis tabungan ada minimum setoran lebih tinggi\n Video call verification pasti diperlukan\n\n **YANG PENTING:**\n Nomor HP Indonesia yang aktif\n Email yang bisa diakses\n Alamat tinggal di Indonesia\n\nSemua dokumen siap? Yuk mulai proses pembukaan! 	\N	\N	2025-07-29 13:58:21.226	2025-07-29 13:58:21.226	[0.006955436430871487, -0.0009003932937048376, 0.01715717650949955, -0.023076143115758896, -0.017209326848387718, 0.0029480750672519207, -0.02066422998905182, -0.009712839499115944, -0.017144139856100082, -0.016779093071818352, 0.007483449764549732, 0.004103512037545443, -0.017548298463225365, 0.011120875366032124, 0.004158920608460903, 0.011890080757439137, 0.024327730759978294, -0.039737898856401443, 0.034418653696775436, -0.0283171646296978, -0.013989096507430077, -0.008291766978800297, -0.014966899529099464, 0.004921606741845608, -0.008467771112918854, 0.029073331505060196, 0.011427253484725952, -0.009856251068413258, -0.008115761913359165, -0.021876703947782516, -0.000595237361267209, -0.002763922093436122, -0.016805168241262436, -0.00132573745213449, -0.007229221053421497, -0.0052247256971895695, -0.013871760107576847, -0